size_t hammingDist(const string& str1, const string& str2) {
    size_t dist = 0;

    for (size_t ind_i = 0; ind_i < str1.size(); ind_i++) {
        if (str1[ind_i] != str2[ind_i]) ++dist;
    }

    return dist;
}

void find_max(
    const vector<pair<string, size_t>>::iterator& begin, const vector<pair<string, size_t>>::iterator& end,
    const vector<int>& groups, int* max_len, vector<size_t>& inds
) {

    const auto size = end - begin;
    vector dp (size, make_pair(1, vector<size_t> {}));



    vector<pair<string, size_t>>::iterator ith_iter;
    vector<pair<string, size_t>>::iterator jth_iter;
    size_t last_best = 0;
    for (long ind_i = 1; ind_i < size; ind_i++) {
        int max_now = 1;
        ith_iter = begin + ind_i;
        bool found {false};
        size_t prev_best_ind;
        vector<size_t> prev_best_inds;

        for (long ind_j = ind_i - 1; ind_j >= 0; ind_j--) {

            jth_iter = begin + ind_j;
            if (groups[ith_iter->second] != groups[jth_iter->second] && dp[ind_j].first+1 > max_now) {

                if (const auto dist = hammingDist(ith_iter->first, jth_iter->first); dist == 1 ) {
                    max_now = dp[ind_j].first + 1;
                    prev_best_ind = jth_iter->second;
                    prev_best_inds = dp[ind_j].second;
                    found = true;
                }
            }
        }
        if (found) {
            dp[ind_i].first = max_now;
            dp[ind_i].second = prev_best_inds;
            dp[ind_i].second.push_back(prev_best_ind);

            if (dp[ind_i].first > *max_len) {
                *max_len = dp[ind_i].first;
                inds = dp[ind_i].second;
                last_best = ith_iter->second;
            }
        }

    }
    if (last_best > 0) {
        inds.push_back(last_best);
    }
}


vector<string> getWordsInLongestSubsequence(vector<string>& words, const vector<int>& groups) {
    const auto size = words.size();

    if (size <= 1)
        return words;

    vector<pair<string, size_t>> str_ind {};
    vector<string> res;
    vector<size_t> res_inds;
    int max_res = 0;


    for (size_t ind = 0; ind < size; ind++)
        str_ind.emplace_back(words[ind], ind);

    ranges::sort(str_ind, [](const pair<string, size_t>& el1, const pair<string, size_t>& el2) {return el1.first.length() < el2.first.length();});


    size_t left = 0;

    while (left < size) {
        size_t equal_len = 1;
        auto begin = std::next(str_ind.begin(), static_cast<long>(left));

        for (size_t ind = left; ind+1 < size && str_ind[ind].first.size() == str_ind[ind+1].first.size(); ind++ ) {

            ++equal_len;
        }
        auto end = next(begin, static_cast<long>(equal_len));
        ranges::sort(begin, end, [](const pair<string, size_t>& el1, const pair<string,size_t>& el2) {return el1.second < el2.second;});

        vector<size_t> conf_inds{begin->second};
        pmr::unordered_set<size_t> seen {};

        int max_nums = 1;


        find_max(begin, end, groups, &max_nums, conf_inds);

        if (max_res < max_nums) {
            max_res = max_nums;
            res_inds = conf_inds;
        }

        left += equal_len;
    }

    for (const auto& ind: res_inds) {
        res.push_back(words[ind]);
    }

    return res;

}

